import React, { Component } from 'react';

class Dropdown extends React.Component {
  constructor() {
    super();
    this.state = {
      time: 30000,
    };
  }

  render() {
    return (
      <select className="dropdown">
        {this.props.data.map((item, index) => (
          <option key={index} value={index}>
            {item}
          </option>
        ))}
      </select>
    );
  }
}
export default Dropdown;
